<blockquote>Заводы компании расположены в Швеции, Италии, Венгрии, Испании, Франции, Румынии, Великобритании, Польше, Германии, Украине, США, Бразилии и других странах мира.</blockquote>

<p>Компания производит бытовую технику, а также профессиональное кухонное и прачечное оборудование для нужд HoReCa (холодильники, посудомоечные, сушильные и стиральные машины, пылесосы, газовые и электрические плиты, воздухоочистители, вытяжки, микроволновые печи, кофеварки, чайники и утюги). Техника Electrolux продаётся по всему миру под торговыми марками Electrolux, Zanussi, AEG, REX, Zoppas, Flymo, Partner, Westinghouse, McCulloch, Eureka и другими.</p>";s:12:"~DETAIL_TEXT";s:1612:"Компанию основал в Стокгольме в 1910 году Аксель Веннер-Грен под названием Elektromekaniska AB. В 1912 году начинается сотрудничество Elektromekaniska AB с компанией AB Lux, производящей с 1901 года уличные керосиновые лампы под маркой Lux. Тогда же (в 1912 году) компания запускает производство первого бытового пылесоса Lux 1.

<blockquote>Заводы компании расположены в Швеции, Италии, Венгрии, Испании, Франции, Румынии, Великобритании, Польше, Германии, Украине, США, Бразилии и других странах мира.</blockquote>

<p>Компания производит бытовую технику, а также профессиональное кухонное и прачечное оборудование для нужд HoReCa (холодильники, посудомоечные, сушильные и стиральные машины, пылесосы, газовые и электрические плиты, воздухоочистители, вытяжки, микроволновые печи, кофеварки, чайники и утюги). Техника Electrolux продаётся по всему миру под торговыми марками Electrolux, Zanussi, AEG, REX, Zoppas, Flymo, Partner, Westinghouse, McCulloch, Eureka и другими.</p>";s:16:"DETAIL_TEXT_TYPE";s:4:"html";s:17:"~DETAIL_TEXT_TYPE";s:4:"html";s:18:"SEARCHABLE_CONTENT";s:2113:"ELECTROLUX
AB ELECTROLUX &MDASH; ШВЕДСКАЯ МАШИНОСТРОИТЕЛЬНАЯ 
КОМПАНИЯ, ОДИН ИЗ ВЕДУЩИХ МИРОВЫХ ПРОИЗВОДИТЕЛЕЙ ЭЛЕКТРИЧЕСКИХ И ГАЗОВЫХ ПРИБОРОВ ДЛЯ ДОМАШНИХ И ПРОФЕССИОНАЛЬНЫХ НУЖД. ЕЖЕГОДНО КОМПАНИЯ ПРОДАЕТ БОЛЕЕ 40 МИЛЛИОНОВ СВОИХ ИЗДЕЛИЙ ПОТРЕБИТЕЛЯМ ИЗ 150 СТРАН. ШТАБ-КВАРТИРА &MDASH; В СТОКГОЛЬМЕ.
КОМПАНИЮ ОСНОВАЛ В СТОКГОЛЬМЕ В 1910 ГОДУ 
АКСЕЛЬ ВЕННЕР-ГРЕН ПОД НАЗВАНИЕМ ELEKTROMEKANISKA AB. В 1912 ГОДУ НАЧИНАЕТСЯ СОТРУДНИЧЕСТВО ELEKTROMEKANISKA AB С КОМПАНИЕЙ AB LUX, ПРОИЗВОДЯЩЕЙ С 1901 ГОДА УЛИЧНЫЕ КЕРОСИНОВЫЕ ЛАМПЫ ПОД МАРКОЙ LUX. ТОГДА ЖЕ (В 1912 ГОДУ) КОМПАНИЯ ЗАПУСКАЕТ ПРОИЗВОДСТВО ПЕРВОГО БЫТОВОГО ПЫЛЕСОСА LUX 1. ЗАВОДЫ КОМПАНИИ РАСПОЛОЖЕНЫ В ШВЕЦИИ, ИТАЛИИ, ВЕНГРИИ, ИСПАНИИ, ФРАНЦИИ, РУМЫНИИ, ВЕЛИКОБРИТАНИИ, ПОЛЬШЕ, ГЕРМАНИИ, УКРАИНЕ, США, БРАЗИЛИИ И ДРУГИХ СТРАНАХ МИРА. 

КОМПАНИЯ ПРОИЗВОДИТ БЫТОВУЮ ТЕХНИКУ, А 
ТАКЖЕ ПРОФЕССИОНАЛЬНОЕ КУХОННОЕ И ПРАЧЕЧНОЕ ОБОРУДОВАНИЕ ДЛЯ НУЖД HORECA (ХОЛОДИЛЬНИКИ, ПОСУДОМОЕЧНЫЕ, СУШИЛЬНЫЕ И СТИРАЛЬНЫЕ МАШИНЫ, ПЫЛЕСОСЫ, ГАЗОВЫЕ И ЭЛЕКТРИЧЕСКИЕ ПЛИТЫ, ВОЗДУХООЧИСТИТЕЛИ, ВЫТЯЖКИ, МИКРОВОЛНОВЫЕ ПЕЧИ, КОФЕВАРКИ, ЧАЙНИКИ И УТЮГИ). ТЕХНИКА ELECTROLUX ПРОДАЁТСЯ ПО ВСЕМУ МИРУ ПОД ТОРГОВЫМИ МАРКАМИ ELECTROLUX, ZANUSSI, AEG, REX, ZOPPAS, FLYMO, PARTNER, WESTINGHOUSE, MCCULLOCH, EUREKA И ДРУГИМИ.";s:19:"~SEARCHABLE_CONTENT";s:2113:"ELECTROLUX
